import myaxios from '../MyAxios';
import BaseUrl from '../BaseUrl';
const cinemaApi = {
	queryCinemaTags() {
		let url = BaseUrl.BMDURL + '/cinema/tags';
		return myaxios.get(url);
	},
};
export default cinemaApi;
